import React from 'react';
import './lib/capabilities.scss';

class Capabilities extends React.Component {

  render() {
    return (
      <div className="capabilities page">
        <div className='cap-bg'>
        <div className='capabilities-content'>
            <div className='capabilities-container'>
                <p className="title">Our  <span>Capabilities</span></p>
                <div className="content-text">
                    <div className="content-left">
                        <p>
                          Years of research and development. Mathematics is the core of our project. Unmatched integration
                          enabled zetanet to be fast, flexible and efficient when transporting data on a encrypted network. We plan to solve every
                          limited capabilities of the current internet. Zetanet's privacy, security and data storage will be the foundation
                          in creating this new internet.
                        </p>

                    </div>
                </div>
            </div>
        </div>
        </div>
      
      </div>
    );
  }
}
export default Capabilities;
